<script>
  // =======================================================
// Script for the Testimonials Carousel (your first one)
// =======================================================
var testimonialsOwl = $(".testimonials-carousel");
testimonialsOwl.owlCarousel({
  loop: true,
  nav: false,
  dots: false,
  autoplay: false,
  autoplayTimeout: 5000,
  autoplayHoverPause: true,
  smartSpeed: 800,
  slideBy: 1,
  responsive: {
    0: { 
        items: 2,
        margin: 5
    },
    299: { 
        items: 3,
        margin: 4
    },
    500: { 
        items: 3,
        margin: 7
    },
    756: { 
        items: 3,
        margin: 10
    },
  },
});

$(".testimonials-next-btn").click(function () {
  testimonialsOwl.trigger("prev.owl.carousel");
});
$(".testimonials-prev-btn").click(function () {
  testimonialsOwl.trigger("next.owl.carousel");
});
</script>
